import React from "react";

const listPage = () => {
  return (
    <nav class="bg-white border-gray-200">
      <div class="flex flex-wrap justify-between items-center mx-auto max-w-screen-xl p-6 px-16">
        <a
          href="https://flowbite.com"
          class="flex items-center space-x-3 rtl:space-x-reverse">
          <span class="self-center text-2xl font-bold whitespace-nowrap dark:text-black">
            TodoList
          </span>
        </a>
        <div class="flex items-center space-x-6 rtl:space-x-reverse">
          <a
            href="#"
            class="text-md  text-blue-600 dark:text-blue-500 hover:underline">
            Login
          </a>
        </div>
      </div>
    </nav>
  );
};

export default listPage;
